import Link from 'next/link';

let Logo = (props) => {
	console.log(props)
	return (
			<img src={props.src} alt={props.alt || ''}  width={props.width || "50"}/>
	)
}

let NavigationLink = (props) => {
	let navLinks = props.linkList.map((lk, index) => (
			<Link href={lk.link} key={index}>
				<a className="navbar-item is-tab"> {lk.name} </a>
			</Link>
		))


	return (
		<div className="navbar-end">
			{navLinks}
		</div>
	);
}


let MainNavigation = () => {
	return (
		<nav className="navbar is-transparent">
			<div className="navbar-brand">
				<Link href="/">
					<a className="navbar-item">
						<Logo 
							src="/static/logo.svg"
							alt="App logo"
							width="120"
						/>
					</a>
				</Link>
				<div className="navbar-burger burger" data-target="mainNav">
			      <span></span>
			      <span></span>
			      <span></span>
			    </div>
			</div>

			<div id="mainNav" className="navbar-menu">
				<NavigationLink 
					linkList={[ 
											{name: 'Home', link: '/'},
											{name: 'About', link: '/about'},
											{name: 'FAQs', link: '/'},
											]}
				/>
			</div>
		</nav>
	)
}

export default MainNavigation;
